  function hexToRgb(hex) {
    // Remove the hash at the start if it's there
    hex = hex.replace(/^#/, "");

    // Parse the hex color
    if (hex.length === 3) {
      // For shorthand hex (e.g., #fff), expand it to 6 digits (e.g., #ffffff)
      hex = hex
        .split("")
        .map(function (char) {
          return char + char;
        })
        .join("");
    }

    // Convert hex to RGB
    const r = parseInt(hex.substring(0, 2), 16);
    const g = parseInt(hex.substring(2, 4), 16);
    const b = parseInt(hex.substring(4, 6), 16);

    // Return RGB object
    return { r, g, b };
  }

